class Exercise {
    constructor(title, fields) {
        this.title = title
        this.fields = fields
    }
}
class Title {
    constructor(code, number) {
        this.code = code
        this.number = number
    }
}

export const exerciseOne = [
    new Exercise("i",
        [
            {
                response: 0,
            },
            {
                response: 1,
            },
            {
                response: 2,
            },
            {
                response: 3,
            },
            {
                response: 4,
            }
        ]
    ),
    new Exercise("console", [
            {
                response: 0,
            },
            {
                response: 1,
            },
            {
                response: 2,
            },
            {
                response: 3,
            },
            {
                response: 4,
            },
        ]
    ),
    new Exercise("condition", [
            {
                response: true,
            },
            {
                response: true,
            },
            {
                response: true,
            },
            {
                response: true,
            },
            {
                response: false,
            }
        ]
    ),
]
export const exerciseOneTitle = new Title (
    "for (let i = 0; i < 5; i++) {\n" +
    "      console.log(i)\n" +
    "}", 1
)
export const exerciseTwo = [
    new Exercise("i",
        [
            {
                response: 5
            },
            {
                response: 4
            },
            {
                response: 3
            },
            {
                response: 2
            },
            {
                response: 1
            }
        ]
    ),
    new Exercise("console",
        [
            {
                response: 5
            },
            {
                response: 4
            },
            {
                response: 3
            },
            {
                response: 2
            },
            {
                response: 1
            }
        ]
    ),
    new Exercise("condition",
        [
            {
                response: true
            },
            {
                response: true
            },
            {
                response: true
            },
            {
                response: true
            },
            {
                response: false
            }
        ]
    )
]
export const exerciseTwoTitle = new Title (
    "for (let i = 5; i <= 0; i--) {\n" +
    "      console.log(i)\n" +
    "}"
)
